    false,nt"url": null,nt"notes": "NODC Accession 0133630 includes physical
    and underway data collected aboard the ROGER REVELLE during cruise RR1404 in the
    Bay of Bengal, Indian Ocean and South China Sea (Nan Hai) from 2014-05-29 to 2014-06-14.
    These data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Bruce Appelgate of University of California - San Diego;
    Scripps Institution of Oceanography as part of Transit. The Lamont-Doherty Earth
    Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling
    Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
